			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "# Build Neverball Installer and package to a dmg.\n# set -x # uncomment for debugging\nset -e # exit on error\n\nSVN_REVISION=`cd ${SRCROOT}/../.. && /usr/local/bin/svn info | grep Revision: | cut -d\\  -f2`\nSVN_REVISION=`echo ${SVN_REVISION} | sed -e 's/\\ //g'`\necho \"*** SVN REV : ${SVN_REVISION}\"\n\nBASE_VERSION=\"v1.5.3\"\n#VERSION=\"${BASE_VERSION} r${SVN_REVISION}\"\nVERSION=\"${BASE_VERSION}\"\nBASE_NAME=\"Neverball $BASE_VERSION\"\nNAME=\"Neverball $VERSION\"\n\nfor app in \"Neverball\" \"Neverputt\"\ndo\n  echo \"+ Cleaning $app\"\n  strip \"${BUILT_PRODUCTS_DIR}/${app}.app/Contents/MacOS/${app}\"\n  rm -fr \"${BUILT_PRODUCTS_DIR}/${app}.app/\"Contents/Frameworks/*.framework/Versions/*/Headers\n  rm -fr \"${BUILT_PRODUCTS_DIR}/${app}.app/\"Contents/Frameworks/*.framework/Headers\ndone\n\necho \"+ Cleaning data\"\nrm -f \"${BUILT_PRODUCTS_DIR}/data/.ok\"\nrm -f \"${BUILT_PRODUCTS_DIR}/data/.ok\"\n\necho \"Building installer and uninstaller...\"\n/Developer/usr/bin/packagemaker -d \"../uninstall.pmdoc\" -o \"${BUILT_PRODUCTS_DIR}/Uninstall Neverball.mpkg\" -i org.neverball.Uninstall.pkg\nsh ../modify_neverball_pkg_uninstaller.sh \"${BUILT_PRODUCTS_DIR}/Uninstall Neverball.mpkg\"\n/Developer/usr/bin/packagemaker -d \"../neverball.pmdoc\" -o \"${BUILT_PRODUCTS_DIR}/${BASE_NAME}.mpkg\"\nsh ../modify_neverball_pkg_installer.sh \"${BUILT_PRODUCTS_DIR}/${BASE_NAME}.mpkg\"\n\necho \"*** Building disk image...\"\n\nimage_rw=\"${BUILT_PRODUCTS_DIR}/${NAME}.sparseimage\"\nimage_ro=\"${BUILT_PRODUCTS_DIR}/${NAME}.dmg\"\n\nMOUNTPOINT=\"/Volumes/$NAME\"\ntest -e \"$MOUNTPOINT\" && {\n  echo \"$MOUNTPOINT already mounted. Please, detach it.\" 1>&2\n  exit 1\n}\n\nrm \"$image_rw\" 2>/dev/null || true\nhdiutil create -type SPARSE -fs HFS+ -volname \"$NAME\" \"$image_rw\"\nhdiutil attach \"$image_rw\"\n\ncp -R \"${BUILT_PRODUCTS_DIR}/${BASE_NAME}.mpkg\" \"${MOUNTPOINT}/${BASE_NAME}.mpkg\"\ncp ../Run\\ Installer.app \"${MOUNTPOINT}/ \"\n#ln -s \"${MOUNTPOINT}/${BASE_NAME}.mpkg\" \"${MOUNTPOINT}/ \"\n\ncp ../neverball.org.webloc \"${MOUNTPOINT}/neverball.org.webloc\"\ncp ../Run\\ Webloc.app \"${MOUNTPOINT}/  \"\n\ncp -R ../readme.rtfd \"${MOUNTPOINT}/readme.rtfd\"\ncp ../Run\\ Readme.app \"${MOUNTPOINT}/   \"\n\n#echo \"+ Install disk icon\"\n#iconfile=\"icon.icns\"\n#cp \"$iconfile\" \"$mountpoint/.VolumeIcon.icns\"\n#/Developer/Tools/SetFile -a aVbstclinmedz \"$MOUNTPOINT/.VolumeIcon.icns\"\n\necho \"+ Install background dmg\"\ncp \"${SRCROOT}/../icons/dmg-background.png\" \"${MOUNTPOINT}/dmg-background.png\"\n\necho \"+ set the presentation\"\n# better to copy this in script editor for change...\nosascript - \"$MOUNTPOINT\" <<!\non run argv\n\tset dir to item 1 of argv\n\ttell application \"Finder\"\n\t\tset f to POSIX file dir as alias\n\t\topen f\n\n\t\tset w to container window of f\n\n\t\tset current view of w to icon view\n\t\tset toolbar visible of w to false\n\t\tset statusbar visible of w to false\n\t\tset opts to icon view options of w\n\t\tset bgfile to file \"dmg-background.png\" of folder f\n\t\t\n\t\t--\tset background color of opts to {50000, 50000, 50000}\n\t\tset background picture of opts to bgfile\n\t\tset icon size of opts to 96\n\t\tset text size of opts to 12\n\t\tset label position of opts to bottom\n\t\tset arrangement of opts to not arranged\n\t\tset position of item \"neverball.org.webloc\" of f to {384/2 - (96 + 20), 214 + 40}\n\t\tset position of item \"  \" of f to {384/2 - (96 + 20), 214 + 40}\n\t\tset position of item \"readme.rtfd\" of f to {384/2 + (96 + 20), 214 + 40}\n\t\tset position of item \"   \" of f to {384/2 + (96 + 20), 214 + 40}\n\t\tset position of item \"${BASE_NAME}.mpkg\" of f to {384/2, 214 + 40}\n\t\tset position of item \" \" of f to {384/2, 214 + 40}\n#\t\tset position of item \"\" of f to {224 + 48, 214 + 40}\n#\t\tset label index of file \"${BASE_NAME}.mpkg\" of folder f to 7\n\t\tset the bounds of w to {100, 100, 484, 604}\n\t\tdelay 5\n\tend tell\nend run\n!\n\nSETICON=/opt/local/bin/seticon #change this if seticon resides in a different location\nMPKGICON=$(ls -kS $(locate metapackage.icns) | head -1)\nWEBLOCICON=$(ls -kr $(locate InternetLocationHTTP.icns) | head -1)\nRTFDICON=$(ls -kS $(locate rtfd.icns) | head -1)\n${SETICON} -d ${MPKGICON} \"${MOUNTPOINT}/ \"\n${SETICON} -d ${WEBLOCICON} \"${MOUNTPOINT}/  \"\n${SETICON} -d ${RTFDICON} \"${MOUNTPOINT}/   \"\nsetfile -a V \"${MOUNTPOINT}/dmg-background.png\"\nsetfile -a V \"${MOUNTPOINT}/${BASE_NAME}.mpkg\"\nsetfile -a V \"${MOUNTPOINT}/neverball.org.webloc\"\nsetfile -a V \"${MOUNTPOINT}/readme.rtfd\"\n\n\necho \"+ Detaching '$NAME' image\"\nhdiutil detach \"$MOUNTPOINT\"\n\n#open \"$image_rw\"\n\necho \"+ Compressing disk image\"\nrm \"$image_ro\" 2>/dev/null || true\nhdiutil convert \"$image_rw\" -imagekey zlib-level=9 -format UDZO -o \"$image_ro\"\n\nrm \"$image_rw\"\n\n# open the result in Finder\nopen \"$image_ro\"\n";
